import React from 'react';
import '../styles/SkeletonContainer.css';
import DataItem from './DataItem';
import { db } from '../DummyData';


function SkeletonContainer({navType, animationType, bothListener, setBothListener}) {
    return (
        <div className={'skeletonContainer'}>{
            db.map( (item, i) => { return(
                //  (i < 4) &&  
                <DataItem  key={i}  className={'skeletonContainer__item'} navType={navType} payload={item} animationType = {animationType} bothListener={bothListener} setBothListener = {setBothListener}/>
            ) } )
        }</div>
    )
}

export default SkeletonContainer
